'use strict';describe('warnOnce',function(){var warnOnce=require('../warnOnce');it('logs warning messages to the console exactly once',function(){jest.spyOn(console,'warn').mockReturnValue(undefined);warnOnce('test-message','This is a log message');warnOnce('test-message','This is a second log message');expect(console.warn).toHaveBeenCalledWith('This is a log message');expect(console.warn).toHaveBeenCalledTimes(1);console.warn.mockRestore();});});